import Contact from './components/Contact';

const App = () => {
	return (
		<Switch>
			<Route exact path="/" component={Homepage} />
			<Route exact path="/quizz" component={Quizz} />
			<Redirect to="/" />
		</Switch>
	);
};

export default App;
